import Link from "next/link";

export default function header() {
	return (
		<div>
			<div>
				<h1>The Header</h1>
				<nav>
					<Link href="/">Home</Link>
					<Link href="/about">About</Link>
				</nav>
			</div>
		</div>
	);
}
